import React, { Component } from "react";
import {
  Navbar,
  NavbarBrand,
  Jumbotron,
  Nav,
  NavbarToggler,
  Collapse,
  NavItem,
} from "reactstrap";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <div>
      <React.Fragment>
        <Jumbotron fluid>
          <div className="container">
            <div className="row"></div>
          </div>
        </Jumbotron>
      </React.Fragment>
    </div>
  );
};

export default Header;
